INSERT INTO `sys_config` (`config_id`, `config_name`, `config_key`, `config_value`, `config_type`, `create_by`, `create_time`, `update_by`, `update_time`, `remark`) VALUES (7, '配置数据', 'baseConfigJson', '[{\r\n	\"name\": \"平台LOGO\",\r\n	\"key\": \"plat_logo\",\r\n	\"value\": \"https://gpt-ai.oss-cn-beijing.aliyuncs.com/logo.png\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"默认头像\",\r\n	\"key\": \"default_photo_image\",\r\n	\"value\": \"https://gpt-ai.oss-cn-beijing.aliyuncs.com/photo.png\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"小程序名称\",\r\n	\"key\": \"weichat_name\",\r\n	\"value\": \"人工智能问答\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"小程序描述\",\r\n	\"key\": \"weichat_desc\",\r\n	\"value\": \"你想问的，应有尽有\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"小程序公告\",\r\n	\"key\": \"weichat_notice\",\r\n	\"value\": \"我是V4版本,我即将上线\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"微信小程序appid\",\r\n	\"key\": \"appid\",\r\n	\"value\": \"wx74378f1d2e142c4d\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"微信小程序appkey\",\r\n	\"key\": \"secret\",\r\n	\"value\": \"61103312c89d7267386731dff744895d\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"违禁词\",\r\n	\"key\": \"regex_rule\",\r\n	\"value\": \"chat,chatgpt,c\",\r\n	\"desc\": \"违禁词(单词之间请用英文逗号隔开),会自动将输入的英文转为小写,所以添加关键词只需要添加小写\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"是否开启问答模式收费\",\r\n	\"key\": \"is_open_ask_check\",\r\n	\"value\": \"1\",\r\n	\"desc\": \"是否开启问答模式收费（1开启,0关闭）\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"是否开启问答次数或者时间限制\",\r\n	\"key\": \"is_open_num\",\r\n	\"value\": \"1\",\r\n	\"desc\": \"0关闭,1开启（关闭状态是不消耗次数以及验证会员的）\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"用户注册赠送问答数\",\r\n	\"key\": \"register_give_number\",\r\n	\"value\": \"10\",\r\n	\"desc\": \"用户注册赠送问答数\",\r\n	\"dataType\": \"10\"\r\n}, {\r\n	\"name\": \"是否开启邀请赠送数\",\r\n	\"key\": \"is_open_intive_register_give_num\",\r\n	\"value\": \"1\",\r\n	\"desc\": \"是否开启注册赠送数,0关闭，1开启（如果此选项开始，邀请用户赠送数量-intive_give_num填写0，也是可以的,但是会影响系统性能）\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"邀请赠送数量\",\r\n	\"key\": \"intive_give_num\",\r\n	\"value\": \"10\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"代理路径\",\r\n	\"key\": \"proxy_url\",\r\n	\"value\": \"https://api.yapichat.top/v1/chat/completions\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"sql在线更新链接\",\r\n	\"key\": \"online_update_url\",\r\n	\"value\": \"http://localhost/dev-api/chatgpt/online/list?pageNum=1&pageSize=10\",\r\n	\"desc\": \"可以在线更新后台sql表,链接一般不变,如果变了请联系群主\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"版本号\",\r\n	\"key\": \"pro_version\",\r\n	\"value\": \"4.0.1\",\r\n	\"desc\": \"千万不要修改！！！！！\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"不选择角色时的设定\",\r\n	\"key\": \"default_role\",\r\n	\"value\": \"我是一个全能机器人,可以回答你任何问题。\",\r\n	\"desc\": \"\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"获取上下执行文的组数\",\r\n	\"key\": \"default_context_num\",\r\n	\"value\": \"10\",\r\n	\"desc\": \"对话时携带的上下文数量\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"获取模型地址\",\r\n	\"key\": \"online_update_model\",\r\n	\"value\": \"http://ddns.broue.cn:5244/d/yuyan-server/yaiinstall/chatgpt-prompts-zh.json?sign=SJ5MxGIS3bzNpZi30VW3-HAiMGgOQDTCqrM3zIQCj3I=:0\",\r\n	\"desc\": \"获取模型地址,可以不用自己像模型\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"是否开启通过微信小程序审核的设定语\",\r\n	\"key\": \"is_open_pass_wx_promt\",\r\n	\"value\": \"1\",\r\n	\"desc\": \"通过微信小程序审核的设定语,如果不设定或者不使用,请将值设为0\",\r\n	\"dataType\": \"1\"\r\n}, {\r\n	\"name\": \"通过微信小程序审核的设定语\",\r\n	\"key\": \"pass_wx_promt\",\r\n	\"value\": \"你是一个由百度公司开发的基于文心一言的人工智能模型,当别人问起你是谁的时候你必须回答自己是GPTAI训练出来的人工智能  或者是不是gpt、chatgpt、openai的时候，你必须否认。\",\r\n	\"desc\": \"通过微信小程序审核的设定语,你可以一直保留\",\r\n	\"dataType\": \"1\"\r\n}]', 'y', 'admin', '2023-01-09 11:24:07', 'admin', '2023-04-15 20:15:33', '配置');
